import React from 'react';
import { FaUserAlt, FaShoppingCart, FaPoo, FaSkull, FaPaw, FaHeart } from 'react-icons/fa';


function Header() {
  // Import result is the URL of your image
  return  <div style={{alignItems: 'left'}}>
      <h2><FaUserAlt />
        <FaShoppingCart />
        <FaPoo />
        <FaSkull />
        <FaPaw />
        <FaHeart />
        <FaPaw />

        
        
      </h2>


      
  </div>

  
   
}

export default Header;
